(1, 'Contact Us', 'contact-us', '<p>grosirieindia@gmail.com</p>', 0, 0, '2020-06-28 17:31:02'),
(2, 'About Us', 'about-us', '<p>Grosirie is the India\'s most safest online store, promising you the best offers on all your daily needs and groceries with some exceptional services to deliver your quality products with a privilege of an incomparable customer care. \r\n\r\nHome delivery services started in Home Town Warangal and to expand to different cities across India.\r\n\r\nSafety and Quality are our Top most priority. \r\nAll our Employees and Delivery executives follow the extreme safety measures and makes sure the customer is satisfied with the service.\r\n\r\nInspired from COVID-19 Lockdown situation which struck India in 2020.</p>\r\n\r\n', 0, 0, '2020-06-30 06:29:09'),
