naccurate, not current or incomplete, or GoGrocer has reasonable grounds to suspect that such information is untrue, inaccurate, not current or incomplete, GoGrocer has the right to suspend or terminate your account and refuse any and all current or future use of the Service (or any portion thereof).</p>\n\n<p>GoGrocer assumes no responsibility and shall incur no liability if it is unable to complete the payment on Payment Date owing to any one or more of the following:</p>\n\n<p>&nbsp; If the Payment Instruction(s) issued by you is/are incomplete, inaccurate, invalid and delayed.</p>\n\n<p>&nbsp; If the Payment Account has insufficient funds/limits to cover for the payment amount.</p>\n\n<p>&nbsp; If your Bank refuses or delays honouring the Payment Instruction(s)</p>\n\n<p>&nbsp; If payment is not processed by biller upon receipt.</p>\n\n<p>&nbsp; Circumstances beyond the control of GoGrocer (including, but not limited to, fire, flood, natural disasters, bank strikes, power failure, systems failure like computer or telephone lines breakdown due to an unforeseeable cause or interference from an outside force)</p>\n\n<p>In case the bill payment is not effected for any reason, you will be intimated about the failed payment by an e-mail or via a message on GoGrocer app or SMS</p>\n\n<p><strong>Delivery fee</strong></p>\n\n<p>GoGrocer offers a facility to Business partners on GoGrocer platform to charge a Delivery fee from users, in addition to or over &amp; above the bill amount. Business partners have right to levy any charge on the transaction. Such charges are billed by the business partners and is not party to any such charge. GoGrocer is not liable for any dispute owing to the same.</p>\n\n<p><strong>Loyalty points OR Reward points</strong></p>\n\n<p>Loyalty program is a feature or facility offered by GoGrocer to business partners on GoGrocer platform. A business partner can avail the service and offer reward points to their customers on GoGrocer based on the terms or configuration of the Loyalty program activated. It helps business partners reach out to their most valuable customers directly and incentivize loyal customers through the program.</p>\n\n<p>Business partner can set the terms of reward points earned on any transaction made by customer with the business. For instance, if the business partner choses to offer 20 points on a transaction of value Rs 100, customer earns 20 points, which can be redeemed to get transferred to the wallet.</p>\n\n<p>Reward points can be earned on completion of a transaction which fulfil business partner&#39;s Reward points program configuration.</p>\n\n<p>Business partner has the rights to define the terms of the reward points program. Eligibility of a transaction to earn or burn is entirely dependent on the Business partner and GoGrocer is not responsible for the same.</p>\n\n<p>Reward points are expired automatically if the Business partner is no longer operational / choses to leave GoGrocer platform / goes bankrupt / shuts business. GoGrocer is not liable to honour the reward points nor is liable for any potential loss of the consumer during such an event.</p>\n\n<p>Reward points are not transferrable from one Business partner to another or from one user to another.</p>\n\n<p>Refund of an equivalent value of Reward points is not possible under any circumstances. The only way to use Reward points is to burn / redeem them during eligible transactions with the respective Business partner.</p>\n\n<p>GoGrocer offers a facility to consumers to redeem / apply / burn Reward points during the payment to the Business Partner. GoGrocer is not responsible for applying / redemption of the Reward points automatically without consumer initiation. No refund / resolution shall be offered by GoGrocer support team in such an event if the consumer misses to apply / burn / redeem loyalty points &amp; completes the payment</p>\n\n<p><strong>Payment Gateway</strong></p>\n\n<p>The Licensed Application makes available a payment gateway through its approved payment processing provider(s). Your use of the payment gateway will be subject to receiving an approved status by the Application Provider, fulfilling the documentation and other requirements of the approved payment processing provider(s) and adhering to the terms and conditions of use prescribed by the payment processing provider(s). Please contact your concerned store or app sub-owner for any queries or refund as payment gateway accounts belongs to it.</p>\n\n<p><strong>Replacement, Refund, Dispute Policy</strong></p>\n\n<p>Any Return, Refund or dispute claim has to be made with the sub-owner of the app i.e. the name on which app has been issues. GoGrocer has no rights or authority to entertain such claims.</p>\n\n<p>All Refunds will be credited to back to payment instrument used by you to complete the payment. It will take 3-21 days for the money to show in your bank account depending on payment participants involved in the payment, including, but not limited to your bank, payment gateway, bank used by payment gateway.</p>\n\n<p><strong>LIMITATION OF LIABILITY</strong></p>\n\n<p>IN NO EVENT SHALL THE APLLICATION PROVIDEDR OR ANY OF ITS SUBSIDIARIES OR AFFILIATES BE LIABLE TO YOU OR ANY PERSON FOR ANY DIRECT, INDIRECT, SPECIAL, CONSEQUENTIAL OR OTHER DAMAGES (INCLUDING, WITHOUT LIMITATION, ANY LOST PROFITS, BUSINESS INTERRUPTION, LOSS OF INFORMATION OR PROGRAMS OR OTHER DATA ON YOUR INFORMATION HANDLING SYSTEM) THAT ARE RELATED TO THE USE OF, OR THE INABILITY TO USE, THE SERVICES AND FUNCTIONS OF THE LICENSED APPLICATION OR ANY LINKED WEB SITE/ MOBILE APPLICATION, EVEN IF THE APPLICATION PROVIDER IS EXPRESSLY ADVISED OF THE POSSIBILITY OF SUCH DAMAGES.</p>\n\n<p><strong>INDEMNITY</strong></p>\n\n<p>You agree to indemnify and hold harmless the Application Provider, its subsidiaries and affiliates from any claim, cost, expense, judgment or other loss relating to your use of the Licensed Application, including without