INSERT INTO `products` (`product_id`, `product_name`, `product_description`, `product_image`, `category_id`, `sub_cat_id`, `product_pincode`, `in_stock`, `price`, `discount_price`, `mrp`, `tax`, `unit_value`, `unit`, `increament`, `rewards`, `loca_category`, `quantity`, `net_weight`, `State_code`, `Location_filter`, `thumbnails_image`) VALUES
(389, 'Gold Drop Refined Sunflower Oil 1Ltr', 'Gold Drop Refined Sunflower Oil is generally used for deep boiling, cooking and many more. It is crystal clear oil which is healthy. It is extracted from good-grade matured sunflower seeds.', 'Gold_Drop_Refined_Sunflower_Oil_1Ltr_200x200.jpg', 57, 33, 0, 1, 131, '111', 0, 0, 1, 'Litre', 0, '00', 0, 4, 910, 0, 0, 'Gold_Drop_Refined_Sunflower_Oil_1Ltr_200x200.jpg'),
(390, 'Freedom Refined Sunflower Oil 1Ltr', 'Freedom Refined Sunflower Oil is clear, light and low absorbing. It is wealthy Vitamins D, A & E which makes it superior for your child health. It is a blend of monounsaturated and polyunsaturated fats with low saturated fat levels.', 'Freedom_Refined_Sunflower_Oil_1Ltr_200x200.jpg', 57, 33, 0, 1, 114, '110', 0, 0, 1, 'Litre', 0, '00', 0, 4, 910, 0, 0, 'Freedom_Refined_Sunflower_Oil_1Ltr_200x200.jpg'),
(399, 'Britannia Good Day Butter Cookies, 75 g', 'The all-time favourite, the classic butterlicious flavour of Britannia Good Day cookies only get better with time. The goodness of rich butter melts in mouth effortlessly, giving a cookie thats loved by everyone. These crumbly cookies are the best partner when you crave munchies between meals. Whats more? It packs in more Good Day Smiles for you Store them in an airtight container and keeps enjoying this yummy indulgence.', 'Britannia_Good_Day_Butter_Cookies_75_g_200x200.jpeg', 61, 60, 0, 1, 10, '10', 0, 0, 1, 'NOS', 0, '00', 0, 5, 75, 0, 0, 'Britannia_Good_Day_Butter_Cookies_75_g_200x200.jpeg'),
(400, 'Sunfeast Yippee Noodles - Magic Masala 420g', 'Sunfeast Yippee Noodles with Magic Masala is quick snack which can be prepared as an afternoon delight for your children. The instant noodles that have been quite popular among children because of the quick turnaround time are now available with masala or spices which add to the taste of the food. This is a 100% vegetarian food item which is normally cooked within 5 minutes.', 'Sunfeast_Yippee_Noodles_-_Magic_Masala_420g_1_200x200.jpeg', 60, 51, 0, 1, 68, '67', 0, 0, 1, 'NOS', 0, '0', 0, 2, 420, 0, 0, 'Sunfeast_Yippee_Noodles_-_Magic_Masala_420g_1_200x200.jpeg'),
(401, 'Everest Spice Powder - Rasam Masala, 100g Pouch', 'Everest Spice Powder - Rasam Masala makes the dish more delicious with its natural ingredients.', 'suprasam-powder-100gm_200x200.jpg', 58, 40, 0, 1, 42, '42', 0, 0, 1, 'NOS', 0, '00', 0, 2, 100, 0, 0, 'suprasam-powder-100gm_200x200.jpg'),
(402, 'Daawat Basmati Rice - Biryani 1KG', 'The signature of an authentic Biryani is the length of the rice grain.  Every single grain of Daawat Biryani Basmati. Rice elongates to 18-24 mm when cooked. ', 'Daawat_Basmati_Rice_-_Biryani_1KG_200x200.jpg', 56, 30, 0, 1, 220, '218', 0, 0, 1, 'NOS', 0, '0', 0, 2, 1, 0, 0, 'Daawat_Basmati_Rice_-_Biryani_1KG_200x200.jpg'),
(403, 'MTR Masala - Sambar Powder, 100g', 'Established in 1924, MTR is the contemporary way to authentic tasting food, Our products are backed by culinary expertise honed, over 8 decades of serving wholesome, tasty and high-quality vegetarian food. Using authentic Indian recipes, the purest and best quality natural ingredients and traditional methods of preparation. We bring you a range of products of unmatched flavour and taste, to delight your family at every meal and every occasion. MTR is your special friend in the kitchen, that helps you bring extra joy to your family\'s everyday celebration with a variety of deliciously tempting food, So make every family occasion a special one, with MTR.', 'MTR_Masala_-_Sambar_Powder_100g_200x200.jpg', 58, 40, 0, 1, 50, '50', 0, 0, 1, 'NOS', 0, '0', 0, 2, 100, 0, 0, 'MTR_Masala_-_Sambar_Powder_100g_200x200.jpg'),
(404, 'Tetley Green Tea - Pure Original, 10 Teabags', 'Tetley Green Tea with its refreshing pure, original flavour contains five times more antioxidants than fruits and vegetables. A cup of Tetley Natural Green Tea helps cleanse from within and eliminates all those pollutants and toxins that our bodies are exposed to on a daily basis!! Rejuvenate yourself every day with a cup of Tetley Natural Green Tea.', 'Tetley_Green_Tea_-_Pure_Original_10_Teabags_200x200.jpg', 60, 84, 0, 1, 60, '60', 0, 0, 1, 'NOS', 0, '00', 0, 3, 10, 0, 0, 'Tetley_Green_Tea_-_Pure_Original_10_Teabags_200x200.jpg'),
(405, 'FunFoods Peanut Butter - Crunchy 340g', 'Variation of the classic peanut butter, conchiness roasted bits of peanut for crunchiness', 'FunFoods_Peanut_Butter_-_Crunchy_340g_200x200.jpg', 60, 55, 0, 1, 169, '169', 0, 0, 1, 'NOS', 0, '0', 0, 2, 340, 0, 0, 'FunFoods_Peanut_Butter_-_Crunchy_340g_200x200.jpg'),
(406, 'Vim Dishwash Bar, 300 g', 'With the Power of 100 lemons, vim bar removes the toughest grease stains the fastets and gives you a pleasant cleaning experience with its refreshing lemon fragrance. \r\nIt has a unique patented plastic coating at the bottom of the bar which helps prevent it from sogging quickly making it last longer than ordinary bars.\r\nVim was the original hand washing bar which invented the category. It is the preferred choice of consumers, tried by 6 out of 10 people everyday. \r\nIt has a unique patented plastic coating at the bottom of the bar which helps prevent it from sogging quickly making it last longer than ordinary bars.\r\nInfused with the Power of 100 lemons and the goodness of Neem, Vim anti- germ bar not only helps clean your dirty smelly utensils quickly & without effort but also provides you germ free utensils. It has a unique patented plastic coating at the bottom of the bar which helps prevent it from sogging quickly. Making it last up to 4 days longer than ordinary bars. Vim bar, being the market leader, is tried by 6 out of 10 people every day. So go ahead & try Vim bar, you wont be disappointed.', 'Vim_Dishwash_Bar_300_g_200x200.jpeg', 62, 63, 0, 1, 20, '20', 0, 0, 1, 'NOS', 0, '00', 0, 20, 300, 0, 0, 'Vim_Dishwash_Bar_300_g_200x200.jpeg'),
(407, 'Odonil Room Spray - Citrus Fresh 270ml', 'Unlike fragrance oil diffusers, Odonil Room Freshener Sprays can be used at any time, anywhere in your home. Just spray it and transform the mood of your family members. This Citrus fragrance injects an invigorating fizz into the air for a sparkling, radiant home atmosphere.', 'Odonil_Room_Spray_-_Citrus_Fresh_270ml_200x200.jpg', 62, 66, 0, 1, 149, '149', 0, 0, 1, 'NOS', 0, '0', 0, 3, 480, 0, 0, 'Odonil_Room_Spray_-_Citrus_Fresh_270ml_200x200.jpg'),
(408, 'Tetley Green Tea - Ginger Mint Lemon - 25 BAGS', 'Tetley Green Tea with the invigorating flavour of ginger, mint and lemon is a flavourful and perfect blend of elements that will be your first step towards a life of wellness! While ginger boasts a range of benefits like soothing ailing muscles, aiding digestion and assimilation, mint acts as a blood purifier and lemon boosts immunity.', 'Tetley_Green_Tea_-_Pure_Original_10_Teabags_200x2001.jpg', 60, 84, 0, 1, 150, '150', 0, 0, 1, 'NOS', 0, '00', 0, 3, 25, 0, 0, 'Tetley_Green_Tea_-_Pure_Original_10_Teabags_200x2001.jpg'),
(419, 'Garnier Color Naturals - Creme Hair Color, 70 ml + 60 g Shade 1, Natural Black', 'Garnier Color Naturals Crme hair colour gives 100% Grey Coverage and beautiful rich colour. It is an ammonia-free hair colour and has a superior Colour Lock technology which gives you a rich long-lasting colour that lasts up to 8 weeks. ', 'Garnier_Color_Naturals_-_Creme_Hair_Color_70_ml__60_g_Shade_1_Natural_Black_200x200.jpg', 63, 70, 0, 1, 180, '180', 0, 0, 1, 'NOS', 0, '0', 0, 2, 60, 0, 0, 'Garnier_Color_Naturals_-_Creme_Hair_Color_70_ml__60_g_Shade_1_Natural_Black_200x200.jpg'),
(420, 'Britannia Good Day Cookies - Rich Cashew, 100 g Pouch', 'Britannia good day rich cashew cookies are prepared of rich cookie dough and packed with the premium collection of cashew nuts. It apt for all ages, the Britannia good day rich cashew cookies are 100% vegetarian and are extremely tasty.', 'Britannia_Good_Day_Butter_Cookies_75_g_200x2001.jpeg', 61, 60, 0, 1, 20, '20', 0, 0, 1, 'NOS', 0, '00', 0, 5, 100, 0, 0, 'Britannia_Good_Day_Butter_Cookies_75_g_200x2001.jpeg'),
(421, 'Indica Hair Colour Natural Black 8g', 'Indica Creme colour is made with the goodness of almond protein which gives 100% grey coverage and locks the colour for long-lasting and vibrant results.', 'Indica_Hair_Colour_Natural_Black_8g_200x200.jpg', 63, 70, 0, 1, 19, '19', 0, 0, 1, 'NOS', 0, '0', 0, 8, 20, 0, 0, 'Indica_Hair_Colour_Natural_Black_8g_200x200.jpg'),
(422, 'Vanish Liquid- Expert Stain Removal Laundry Additive, 180 ml', 'Only detergents are not enough for removing tough stains and most of the times the stain remains on the clothes even after a wash with detergent. Get enhanced cleaning first time, every time with Vanish- Expert Stain Removal Laundry Additive. With its advance oxygen power, Vanish removes even the toughest dried-on stains, ensuring a stain-free laundry. The liquid is absolutely safe to be used on both coloured and white clothes.\r\n Delivers unbeatable stain removal efficacy that no detergent alone can deliver \r\n Eliminates the toughest of stains that no washing powder alone can remove. \r\n Whitens your whites and brightens your coloured garments with its active brighteners. \r\n Vanish can easily be used for both hand wash and machine wash clothes, in its raw or diluted form. Add Vanish along with your detergent and get dry-clean like results for your everyday clothes with every wash. ', 'Vanish_Liquid-_Expert_Stain_Removal_Laundry_Additive_180_ml_200x200.jpg', 62, 62, 0, 1, 59, '59', 0, 0, 1, 'NOS', 0, '00', 0, 2, 180, 0, 0, 'Vanish_Liquid-_Expert_Stain_Removal_Laundry_Additive_180_ml_200x200.jpg'),
(423, 'Indica Hair Colour Natural Black 40g (8N*5G)', 'Indica Creme colour is made with the goodness of almond protein which gives 100% grey coverage and locks the colour for long-lasting and vibrant results.', 'Indica_Hair_Colour_Natural_Black_8g_200x2001.jpg', 63, 70, 0, 1, 152, '152', 0, 0, 1, 'NOS', 0, '0', 0, 8, 150, 0, 0, 'Indica_Hair_Colour_Natural_Black_8g_200x2001.jpg'),
(424, 'Vanish Laundry Stain Removal Powder - Additive, 100g', 'Only laundry detergents are not enough for removing tough stains and most of the times the stain remains on the clothes even after a wash with detergent. Therefore, Vanish. Vanish is an expert laundry additive that specializes in removal of tough stains in only 1 wash with its active oxygen formula. It also whitens your whites and brightens your coloured garments with its active brighteners to give you dry clean like results for your everyday clothes. Also available in Liquid format. Get enhanced cleaning first time every time. With its advance oxygen power, Vanish removes even the toughest dried-on stains, ensuring a stain-free laundry. The powder is absolutely safe to be used on both coloured and white clothes.', 'Vanish_Laundry_Stain_Removal_Powder_-_Additive_100g_200x200.jpg', 62, 62, 0, 1, 55, '55', 0, 0, 1, 'NOS', 0, '00', 0, 2, 100, 0, 0, 'Vanish_Laundry_Stain_Removal_Powder_-_Additive_100g_200x200.jpg'),
(425, 'Parle Hide & Seek Chocolate, 120 g Pouch', 'Play a game of hide and seek with your taste buds. Indulge in the mouth-watering delight of Indias best-moulded chocolate chip biscuits, Hide & Seek. All it takes is one bite, and you are transported to chocolate Heaven. Packed with a bounty of chocolate chips, once you try Hide & Seek, you will never want any other biscuit again.', 'Parle_Hide__Seek_Chocolate_120_g_Pouch_200x200.jpg', 61, 60, 0, 1, 30, '30', 0, 0, 1, 'NOS', 0, '00', 0, 4, 120, 0, 0, 'Parle_Hide__Seek_Chocolate_120_g_Pouch_200x200.jpg'),
(426, 'Godrej aer Pocket, Bathroom Air Fragrance - Assorted Pack of 3 (3x10g)', 'Contains any 3 units of our 5 variants (3x10g) - Violet Valley Bloom, Bright Tangy Delight, Fresh Lush Green, Petal Crush Pink and Morning Misty Meadows.\r\nGodrej aer pocket, Bathroom Air Fragrance - Assorted Pack of 3 (3x10g). \r\nEasy to use - simply unwrap and hang it with hook provided.\r\nUnique power gel technology which ensures the fragrance reaches every corner of your bathroom.', 'Godrej_aer_Pocket_Bathroom_Air_Fragrance_-_Assorted_Pack_of_3_3x10g_200x200.jpg', 62, 66, 0, 1, 160, '160', 0, 0, 1, 'NOS', 0, '00', 0, 2, 3, 0, 0, 'Godrej_aer_Pocket_Bathroom_Air_Fragrance_-_Assorted_Pack_of_3_3x10g_200x200.jpg'),
(427, 'Veet Hair Removal Cream For Sensitive Skin 32g', 'Get the smooth skin and the freedom to wear any look, any time with Veet. Veet Hair Removal Cream for Sensitive Skin, enriched with Aloe Vera and Vitamin E, is the right solution when going to the salon is not an option. It effectively removes even short stubborn hair and leaves skin moisturized for up to 24 hours*. It can be used on legs, arms, bikini line and underarms for a perfectly finished hair-less skin. Veet Hair Removal Cream for Sensitive Skin gives you perfect hair removal results in up to 10 minutes. Easy steps and the special spatula inside the pack helps you uproot hair in one easy move. Before using this product, please read the pack precautions carefully.', 'Veet_Hair_Removal_Cream_For_Sensitive_Skin_32g_200x200.jpg', 63, 71, 0, 1, 82, '82', 0, 0, 1, 'NOS', 0, '0', 0, 3, 32, 0, 0, 'Veet_Hair_Removal_Cream_For_Sensitive_Skin_32g_200x200.jpg'),
(428, 'Parle Krackjack Biscuits 200g', 'Parle Krack Jack Biscuit is a crunchy and tasty biscuit with an ideal balance of sweetness and saltiness. Once you begin relishing it, you won\'t be able to end. You will desire for more. Although Krackjack sweet and salty biscuits can be enjoyed anytime, it leaves wonderfully well with your evening cup of tea.', 'Parle_Krackjack_Biscuits_200g_200x200.png', 61, 58, 0, 1, 30, '30', 0, 0, 1, 'NOS', 0, '0', 0, 2, 200, 0, 0, 'Parle_Krackjack_Biscuits_200g.png');
